#### Important Equations and Principles

1. **Frequency Dictionary**
   - **Purpose**: To count the occurrences of each element in a list.
   - **Pseudocode**:
     ```plaintext
     Procedure createFrequencyDict(aList)
         freqDict = {}
         foreach a in aList{
             if(iskey(freqDict, a)){
                 freqDict[a] = freqDict[a] + 1
             }
             else{
                 freqDict[a] = 1
             }
         }
         return(freqDict)
     End createFrequencyDict
     ```

2. **Dictionary Update**
   - **Purpose**: To update a dictionary with new keys and values.
   - **Pseudocode**:
     ```plaintext
     Procedure updateDictionary(D, Y)
         if(not iskey(D, Y.CustomerName)){
             D[Y.CustomerName] = {"Shop": {}, "Category": {}}
         }
         D[Y.CustomerName]["Category"][Y.ShopName] = True
         foreach A in Y.ItemList{
             D[Y.CustomerName]["Category"][A.Category] = True
         }
         return(D)
     End updateDictionary
     ```

3. **List Manipulation**
   - **Purpose**: To manipulate lists by adding, removing, or updating elements.
   - **Pseudocode**:
     ```plaintext
     Procedure doSomething(aList)
         bdict = {}
         blist = []
         foreach a in aList{
             if(not isKey(bdict, a)){
                 bdict[a] = True
                 blist = [a] ++ blist
             }
         }
         return(blist)
     End doSomething
     ```

4. **Conditional Counting**
   - **Purpose**: To count elements based on specific conditions.
   - **Pseudocode**:
     ```plaintext
     Procedure processword(M, Y)
         i = 1
         while(i <= Y.LetterCount){
             p = ith letter of Y.word
             if(p is a consonant and not(member(M, p))){
                 M = M ++ [p]
             }
             i = i + 1
         }
         return(M)
     End processword
     ```

